const Note = ({ note, toggleImportance, deleteById }) => {
  const label = note.important 
    ? 'make not important' 
    : 'make important';

  return (
    <li className='note'>
      {note.content}
      Name: {note.name}
      Number: {note.number} 
      <button onClick={toggleImportance}>{label}</button>
      <button onClick={deleteById}>Delete</button>
    </li>
  )
}

export default Note
